import React from "react";
import GridList from "@material-ui/core/GridList";
import GridListTileBar from '@material-ui/core/GridListTileBar';
import GridListTile from "@material-ui/core/GridListTile";
import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';

const Project = (props) => {

    return <GridList cellHeight={180} className="project-container">
        <GridListTile cols={2}>
            <ListSubheader component="div"><h1>Projects</h1></ListSubheader>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
            <GridListTileBar
              title={"TweetTrace"}
              subtitle={<span>by: Daniel</span>}
              actionIcon={
                    <IconButton >
                        Github
                    </IconButton>
              }
            />
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
    </GridList>
}

export default Project
